    <script src="https://cdnjs.cloudflare.com/ajax/libs/socket.io/3.1.0/socket.io.js" integrity="sha512-+l9L4lMTFNy3dEglQpprf7jQBhQsQ3/WvOnjaN/+/L4i0jOstgScV0q2TjfvRF4V+ZePMDuZYIQtg5T4MKr+MQ==" crossorigin="anonymous"></script>
    <script>
        var clientSide = false;
        document.getElementById("toggle").addEventListener("click", () => {
            clientSide = !clientSide
            document.getElementById("toggle").innerHTML = clientSide ? "Use Server-sided Bypass(stable)" : "Use Client-sided Bypass(beta)"
        })

        function start() {
            document.getElementById("h").innerHTML = "Unshortening..."
            document.getElementById("ad").href = "#"
            document.getElementById("ad").innerHTML = ""
            url = document.getElementById("url").value
            if (clientSide) {
                clientbypass(url)
            } else {
                serverbypass(url)
            }

        }


        function clientbypass(url) {
            var api = "https://fghfgh.codergautamyt.repl.co/api?url="
                //var api = "http://localhost:3000/api?url="


            linkvertise(url).then(json => {
                    console.log(json)
                    if (json) {
                        document.getElementById("h").innerHTML = "Bypassed Linkvertise!";
                        document.getElementById("ad").href = json
                        document.getElementById("ad").innerHTML = json
                    } else {
                        document.getElementById("h").innerHTML = "Error"
                        document.getElementById("ad").href = "#"
                        ocument.getElementById("ad").innerHTML = "Unexpected error contact developers via discord"
                    }
                })
                .catch(err => {
                    document.getElementById("h").innerHTML = "Error"
                    document.getElementById("ad").href = "#"
                    document.getElementById("ad").innerHTML = err
                })

        }

        function serverbypass(url) {
            var api = "https://fghfgh.codergautamyt.repl.co/api?url="
                //var api = "http://localhost:3000/api?url="

            fetch(api + url).then(b => b.json()).then(json => {
                if (json.success) {
                    document.getElementById("h").innerHTML = "Bypassed Linkvertise!";
                    document.getElementById("ad").href = json.bypassedlink
                    document.getElementById("ad").innerHTML = json.bypassedlink
                } else {
                    document.getElementById("h").innerHTML = "Error"
                    document.getElementById("ad").href = "#"
                    ocument.getElementById("ad").innerHTML = json.errormsg
                }
            })
        }


        function change(url) {
